(1866, 384, 'hidden dangers', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 156, 994, '2016-10-04 10:15:12', NULL, 'GiuliaComini '),
(2886, 384, 'eliminates the deficiencies in traditional fans', 0.5, 0, 0.5, 'pro', '', 'Basic', ', ', 473, 792, '2017-02-24 14:39:49', 'GiuliaComini', 'GiuliaComini '),
(1868, 384, 'the airflow will pass by the abrupt changes or the bosses and then the resitance increases. and noise will be caused at the interface between the air outlets and the internal passage for airflow under the action of air shear forces and other acting forces', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 424, 953, '2016-10-04 10:17:07', NULL, 'GiuliaComini '),
(1869, 384, 'the air inlets of the base, which are in communiction with the outside are prone to being influenced from the external enviroment. Dust, oil stain and the like from the external enviroment are likely to come inside the fan through the air inlets during the operation of the fan, which also cause more noise', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 419, 1088, '2016-10-04 10:18:41', NULL, 'GiuliaComini '),
(1870, 384, 'bladeless fan devices are also disclosed in other patente reference documents, such as cn201568337u, kr100985378 raised to efficiently reduce the noise creataed in the bladeless fan', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 699, 801, '2016-10-04 10:19:52', NULL, 'GiuliaComini '),
(1871, 384, 'about 90% of the interior space of the base is occupied by the impeller assembled; so there is only abou t10% of the interior space of the base available for airflow that flows into the outher casing. It is to say, the space provided by the duct  for the airflow is the gap between the impeller and the outher casing. When airflow flows into the air ducts, it will give rise to loud whistlers due to abrupt change of its flowing passage', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 695, 944, '2016-10-04 10:21:55', NULL, 'GiuliaComini '),
(1872, 384, 'the impeller will also create noise during its operation', 0.5, 0, 0.5, 'con', 'GiuliaComini', 'Basic', '', 684, 1094, '2016-10-04 10:22:21', NULL, 'GiuliaComini '),
(1873, 384, 'can reduce noise created in the fan', 0.5, 0, 0.999512, 'pro', 'GiuliaComini', 'Basic', '', 1010, 856, '2016-10-04 10:22:53', NULL, 'GiuliaComini '),
(1874, 384, 'cools user with natural and soft wind', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 959, 686, '2016-10-04 10:23:15', NULL, 'GiuliaComini '),
(1875, 384, 'safer by getting rid of the deficiency that people may be hurt by rotating blades', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 998, 558, '2016-10-04 10:23:55', NULL, 'GiuliaComini '),
(1876, 384, 'isolate, obstruct and separate noise created in the outer casing during operation of the fan', 0.5, 0, 0.9375, 'pro', 'GiuliaComini', 'Basic', '', 928, 1014, '2016-10-04 10:24:34', NULL, 'GiuliaComini '),
(1877, 384, 'absorb noise generated in the outher casing', 0.5, 0, 0.9375, 'pro', 'GiuliaComini', 'Basic', '', 1172, 1018, '2016-10-04 10:24:54', NULL, 'GiuliaComini '),
(1878, 384, 'enlarge the airflow into the fan', 0.5, 0, 0.75, 'pro', 'GiuliaComini', 'Basic', '', 1225, 769, '2016-10-04 10:25:17', NULL, 'GiuliaComini '),
(1879, 384, 'the second noise-reduction component is set inside the impeller fixture, with its position and shape of the impeller fixture', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 1196, 1230, '2016-10-04 10:25:53', NULL, 'GiuliaComini '),
(1880, 384, 'the first noise-reduction component is set on the inner wall of the outer casing, at the interface between the air outlets and the internal passage for airflow, and in the sace between the outler side of the impeller and the inner wall of the outer casing', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 978, 1158, '2016-10-04 10:27:16', NULL, 'GiuliaComini '),
(1881, 384, 'the first noise reduction component is made of steel plates, lead plates, brick walls or other materials of higher densitiy', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 808, 1312, '2016-10-04 10:28:08', NULL, 'GiuliaComini '),
(1882, 384, 'the first noise reduction component is trapezoidally distributed from the outer casing to the air outlets along the inner wall of the outer casing, with the sectional area in the vicinity of the air outlets smaller than the sectional area in the vicinity of the air inlets. There is a gap between the first noise-reductiion component and the impeller', 0.5, 0, 0.5, 'pro', 'GiuliaComini', 'Basic', '', 1072, 1352, '2016-10-04 10:29:34', NULL, 'GiuliaComini ');
