(2703, 480, 'Cooking with aluminum foil can result in the ingestion of aluminum, which is a risk factor for Alzheimer\'s disease.', 0.5, 0, 0.890625, 'issue', '', 'Basic', '', 518, 520, '2017-01-19 16:23:15', 'oc511', 'oc511 '),
(2704, 480, 'Simply put, if you cook with aluminum foil, you are playing with your health. The first thing you need to know is that aluminum is bad for your brain. It is a neurotoxic heavy metal that has been linked to Alzheimerâ€™s disease for years.', 0.5, 0.5, 0, 'pro', '', 'Basic', '', 27, 646, '2017-01-19 16:26:04', 'oc511', 'oc511 '),
(2705, 480, 'cooking with aluminum foil will liberate aluminum and be transferred to your food in a form that can be ingested; second, that this aluminum will reach your brain in concentrations high enough to be significant; and third, that high concentrations of aluminum in your brain put you at increased risk of Alzheimerâ€™s.', 0.5, 0, 0.5, 'pro', '', 'Basic', '', 20, 816, '2017-01-19 16:28:03', 'oc511', 'oc511 '),
(2706, 480, 'Aluminum foil used in cooking provides an easy channel for the metal to enter the human body. The increase in cooking temperature causes more leaching. The leaching is also highly dependent on the pH value of the food solution, salt, and spices added to the food solutions.', 0.5, 0, 0.125, 'pro', '', 'Basic', '', 303, 817, '2017-01-19 16:29:40', 'oc511', 'oc511 '),
(2707, 480, 'A 2011 report in the journal Neuroscience stated that â€œhealthy humans and laboratory rats absorb between 0.06% and 0.4% of ingested Alâ€.', 0.5, 0, 0.75, 'con', '', 'Basic', '', 239, 1022, '2017-01-19 16:30:18', 'oc511', 'oc511 '),
(2708, 480, ' According to the World Health Organization, once the aluminum does make it into your bloodstream, a very small percentage (of an already small percentage of ingested aluminum) actually ends up in your brain', 0.5, 0, 0.5, 'pro', '', 'Basic', '', 215, 1195, '2017-01-19 16:31:20', 'oc511', 'oc511 '),
(2709, 480, 'The debate about the connection between aluminum and Alzheimerâ€™s has gone on for decades, originally inspired by the observation that the brains of Alzheimerâ€™s patients had high concentrations of aluminum compounds and that a major symptom of the disease is the buildup of plaque that contains aluminum compounds.', 0.5, 0, 0, 'pro', '', 'Basic', '', 537, 815, '2017-01-19 16:32:24', 'oc511', ''),
(2710, 480, 'A number of studies have found weak associations between living in areas with elevated aluminum levels in drinking water and an increased risk (or prevalence) of Alzheimerâ€™s disease; ', 0.5, 0, 0, 'con', '', 'Basic', '', 772, 819, '2017-01-19 16:33:09', 'oc511', 'oc511 '),
(2711, 480, 'other studies have not found significant associations.', 0.5, 0, 0, 'con', '', 'Basic', '', 1036, 857, '2017-01-19 16:34:38', 'oc511', ''),
(2712, 480, 'no significant associations have been found between tea consumption or antacid use and the risk of Alzheimerâ€™s disease; although the levels of aluminum in tea and antacids are very high compared to drinking water, aluminum from these sources is poorly absorbed', 0.5, 0, 0, 'con', '', 'Basic', '', 1045, 695, '2017-01-19 16:36:42', 'oc511', ''),
(2713, 480, 'The available data do not suggest that aluminum is a causative agent of Alzheimerâ€™s disease; however, it is possible that it may play a role in the disease development.', 0.5, 0, 0, 'con', '', 'Basic', '', 1032, 557, '2017-01-19 16:36:58', 'oc511', ''),
