(7602, 864, 'The federal emergency brake mechanism is being discussed today by MPs. Covid is out of control and Germany may not reemerge from the crisis by the end of summer.', 0.5, 0.4375, 0, 'answer', '', 'Rejected', '', 660, 494, '2021-06-04 08:31:23', 'bti19', 'bti19 '),
